import React, { useEffect, useState } from 'react';
import { BrowserRouter as Router, Routes, Route } from 'react-router-dom';
import Home from './pages/Home';
import AllPropertiesPage from './pages/AllPropertiesPage';
import ChaletDetailPage from './pages/ChaletDetailPage';
import Login from './pages/Login';
import Register from './pages/Register';
import AdminDashboard from './pages/AdminDashboard';
import UserDashboard from './pages/UserDashboard';
import DashboardOverview from './components/DashboardOverview';
import UserManagement from './components/UserManagement';
import PropertyManagement from './components/PropertyManagement';
import ReportsSection from './components/ReportsSection';
import ComingSoon from './pages/ComingSoon';
import ProtectedRoute from './components/ProtectedRoute';
import AdminRoute from './components/AdminRoute';
import UserRoute from './components/UserRoute';

function App() {
  const [authState, setAuthState] = useState({
    isAuthenticated: false,
    isAdmin: false,
    isUser: false,
    loading: true
  });

  useEffect(() => {
    // Check authentication status
    const checkAuth = () => {
      const user = JSON.parse(localStorage.getItem('user') || '{}');
      const isAuthenticated = !!user && !!user.email;

      setAuthState({
        isAuthenticated,
        isAdmin: isAuthenticated && user.is_admin,
        isUser: isAuthenticated && !user.is_admin,
        loading: false
      });
    };

    checkAuth();
  }, []);

  // Show loading state if still checking authentication
  if (authState.loading) {
    return <div>Loading...</div>;
  }

  return (
    <Router>
      <div className="App">
        <main>
          <Routes>
            {/* Public Routes */}
            <Route path="/" element={<Home scrollTo="hero" />} />
            <Route path="/home" element={<Home scrollTo="hero" />} />
            <Route path="/properties" element={<AllPropertiesPage />} />
            <Route path="/about" element={<Home scrollTo="about" />} />
            <Route path="/contact" element={<Home scrollTo="contact" />} />
            <Route path="/coming-soon" element={<ComingSoon />} />
            <Route path="/login" element={<Login />} />
            <Route path="/register" element={<Register />} />
            <Route path="/ChaletDetailPage" element={<ChaletDetailPage />} />
            <Route path="/chalet/:slug" element={<ChaletDetailPage />} />

            {/* Protected Routes - Require Authentication */}
            <Route element={<ProtectedRoute isAuthenticated={authState.isAuthenticated} />}>
              {/* Admin Only Routes */}
              <Route element={<AdminRoute isAdmin={authState.isAdmin} />}>
                <Route path="/admin-dashboard" element={<AdminDashboard />} />
                <Route path="/admin-dashboard/overview" element={<DashboardOverview />} />
                <Route path="/admin-dashboard/users" element={<UserManagement />} />
                <Route path="/admin-dashboard/properties" element={<PropertyManagement />} />
                <Route path="/admin-dashboard/reports" element={<ReportsSection />} />
              </Route>

              {/* User Only Routes */}
              <Route element={<UserRoute isUser={authState.isUser} />}>
                <Route path="/user-dashboard" element={<UserDashboard />} />
                {/* Add other user-specific routes here */}
              </Route>
            </Route>

            {/* 404 Route - Keep at the end */}
            <Route path="*" element={<Navigate to="/" replace />} />
          </Routes>
        </main>
      </div>
    </Router>
  );
}

export default App;
